INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Nesciunt nostrum mollitia in sit maiores officia nulla.', 'Harum nam ad est at qui dignissimos blanditiis. Qui voluptates eos eius nemo. Provident est corrupti eveniet eum totam ut qui.', 'Minus tempore maxime ullam est quae nesciunt totam. Sunt vel quod quibusdam omnis quisquam. Quis labore qui fugiat explicabo. Qui tempore quas nesciunt.', '2003-07-31');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Rerum cum voluptatum et autem ducimus quo et.', 'Veritatis minus aut ullam. Voluptatem dolores voluptatem suscipit et nihil. Eligendi repellendus magni est autem aut maxime. Ut voluptatibus cupiditate cum vero fugit.', 'Error perspiciatis quasi aspernatur ut voluptatibus est ipsum et. Maxime velit itaque voluptas. Recusandae est aut tenetur id consequatur commodi. Officia voluptatibus est iste corrupti rerum.', '1973-02-03');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Nemo consectetur qui odio fugit voluptatem voluptatem.', 'Libero quo quae vel laudantium ducimus. Nihil doloribus quos culpa harum sapiente. Itaque qui maiores facilis doloribus provident.', 'Non provident laudantium repudiandae sed consequatur. Velit totam quibusdam dicta necessitatibus.', '1974-12-15');
